    [],nt"revision_timestamp": "2016-03-28T18:43:14.814827",nt"name": "obprelim-observer-preliminary-data-system",nt"isopen":
    false,nt"url": null,nt"notes": "Paper logs are the primary data collection
    tool used by observers of the Northeast Fisheries Observer Program and Industry
    Funded Scallop Program deployed on commercial fishing vessels.  Data collected on
    paper logs are used to enter critical data fields into a web-based data entry program,
    OBPRELIM, and loads data directly into Oracle tables.  OBPRELIM is used to enter
    trip, incidental take, and haul level data for in-season quota monitored fisheries
    and discard log data for the herring and longfin squid fisheries to track slippage
    events.  OBPRELIM contains built in audit checks to increase data quality.  OBPRELIM
    is also used for post-entry Fisheries Sampling Branch processing and verification.",nt"license_title":
